function setupScales(data, areas) {
    // update my sliders with min /max values
     var series = data.getSeries(),
        xyValues = series.reduce(function(all, series){
            all.xs = all.xs.concat(series.values.pluck('x'));
            all.ys = all.ys.concat(series.values.pluck('y'));
            return all;
        }, {xs: [], ys: []});
    var xMin = Math.min.apply(null, xyValues.xs),
        xMax = Math.max.apply(null, xyValues.xs),
        yMin = Math.min.apply(null, xyValues.ys.concat([0])),
        yMax = Math.max.apply(null, xyValues.ys);
    this.get('XMinSlider').max = xMax
    this.get('XMinSlider').min = xMin
    this.get('XMaxSlider').max = xMax;
    this.get('XMaxSlider').min = xMin;
    this.get('YMinSlider').max = yMax;
    this.get('YMinSlider').min = yMin;
    this.get('YMaxSlider').max = yMax;
    this.get('YMaxSlider').min = yMin;
    // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-
    var xScales = areas.collect(function(area) {
            var w = area.width;
            return d3.scale.linear().range([0, w]).domain([this.xMin, this.xMax]);
        }, this),
        yScales = areas.collect(function(area) {
            var h = area.height;
            return d3.scale.linear().range([h, 0]).domain([this.yMin, this.yMax]);
        }, this);
    return {x: xScales, y: yScales};
}

