    var btn = this.getMorphNamed("CollapseButton");
    if (btn.hiddenMorphs) {
        for (var i = 0; i < btn.hiddenMorphs.length; i++) {
            var hidden = btn.hiddenMorphs[i];
            if (hidden === name) return hidden;
            var found = hidden.withAllSubmorphsDetect(function(ea) { return ea.name === name; });
            if (found) return found;
        }
    }
    return $super(name);
}

